		//Producto preseleccionado
		function ProductoPreseleccionado() {
			var animacionbak = animar_formas_pago;
			animar_formas_pago = false; //Preseleccion no hace scroll

			var $productos = $('#productos .producto');
			var $ultimo_producto = $('#productos .producto.seleccionado');
			var id_producto = location.hash.replace(/^#+/g, '');
			if (id_producto) {
				if (id_producto == '!') {
					if ($vermas.length) $vermas.click();
					//if( $productos.length==1 ) $productos.eq(0).click();
					//else if( $('.producto_recomendado').length ) $('.producto_recomendado').eq(0).click();
				}
				else if (document.getElementById(id_producto)) {
					var $producto = $('#' + id_producto);
					if ($('#featured_' + id_producto).length) $producto = $('#featured_' + id_producto);
					//else if( !$producto.is(':visible') && $vermas.length ) $vermas.click();
					$producto.click();
				}
				else {
					var idx_producto = location.hash.match(/^#p(?:roducto?)?([0-9]+)$/);
					if (idx_producto != null) idx_producto = parseInt(idx_producto[1]);
					else idx_producto = 0;
					if (idx_producto) {
						var $producto = $productos.eq(idx_producto - 1);
						if ($vermas.length) {
							$producto = $('#productos .destacados + div .producto').eq(idx_producto - 1);
							if ($('#featured_' + $producto.attr('id')).length)
								$producto = $('#featured_' + $producto.attr('id'));
							else $vermas.click();
						}
						$producto.click();
					}
					else if ($productos.length == 1) $productos.eq(0).click();
					else if ($('.producto_recomendado').length) {
						//animar_formas_pago = !$.isMobile;
						$('.producto_recomendado').eq(0).click();
					}
				}
			}
			else if ($ultimo_producto.length) $ultimo_producto.eq(0).click();
			else if ($productos.length == 1) $productos.eq(0).click();
			else if ($('.producto_recomendado').length) {
				//animar_formas_pago = !$.isMobile;
				$('.producto_recomendado').eq(0).click();
			}

			animar_formas_pago = animacionbak;
		}


		/* PAGAR ***************************************************************************************************************/
		$pagar.on('submit', 'form', function (evt) {
			evt.preventDefault();
			if (!semaforo_guardar_pagar) return false;
			semaforo_guardar_pagar = false;

			var $form = $(this);
			var url = $form.attr('action');
			var data = $form.serialize();

			if ($('#selector_formas_pago .forma_pago.selected').length) {
				if ($('#selector_formas_pago .forma_pago.selected input').length)
					data += '&' + $('#selector_formas_pago .forma_pago.selected input').serialize();
				if ($('#selector_formas_pago .forma_pago.selected select').length)
					data += '&' + $('#selector_formas_pago .forma_pago.selected select').serialize();
			}
			else {
				$('#error_forma_pago span').html('Debes seleccionar una forma de pago.');
				$('#error_forma_pago').show();
				semaforo_guardar_pagar = true;
				return false;
			}

			if ($('#acepto_terminos_condiciones').length) {
				data += '&acepto_terminos_condiciones=' + $('#acepto_terminos_condiciones').val();
			}

			Ajax(url, data, function (data) {
				if (typeof data['error'] != 'undefined') {
					$('.error').hide();
					if (typeof data['error'] == 'object') {
						for (var element in data['error']) {
							if (element == 'admin') alert(data['error'][element]);
							else {
								$('#error_' + element + ' span').html(data['error'][element]); //.text()
								$('#error_' + element).show();
							}
						}
					}
					else {
						alert(data['error']);
					}
					semaforo_guardar_pagar = true;
				}
				else {
					if (typeof data['action'] == 'undefined' || !data['action']) {
						alert('Se ha producido un error al generar el pedido, vuelvelo a intentar. Si el error sigue producindose ponte en contactacto con nosotros.');
						semaforo_guardar_pagar = true;
						return false;
					}

					if (typeof data['vars'] != 'undefined')
						for (var key in data['vars']) {
							if (!$form[0].elements[key]) $form.append('<input type="hidden" name="' + key + '" value="' + data['vars'][key] + '"/>');
							else $form[0].elements[key].value = data['vars'][key];
						}

					if (typeof data['method'] != 'undefined') {
						if (data['method'] == 'redirect') {
							location.href = data['action'];
							return;
						}
						$form.attr('method', data['method']);
					}
					$pagar.off('submit', 'form');
					$form.attr('action', data['action']);
					$('.submit', $form).click();
				}
			}, function () {
				alert('Se ha producido un error al generar el pedido, vuelvelo a intentar. Si el error sigue producindose ponte en contactacto con nosotros.');
				semaforo_guardar_pagar = true;
			}, true);
		});

		$pagar.on('click', '.submit', function (evt) {
			if ($(this).hasClass('disabled')) {
				evt.preventDefault();
				evt.stopPropagation();
			}
		});

		$(document).on('set', 'form', function (evt, campo, valor) {
			this.elements[campo].value = valor; //$( '[name="'+campo+'"]', this ).val( valor );
		});


