		$promocode.submit(function (evt) {
			evt.preventDefault();

			var $form = $(this);
			var $forms_pago = $('form', $pagar);
			var $producto = $('.producto_selected');

			AjaxForm($form.attr('id'), function (data) {
				try {
					data = JSON.parse(data);
					if (data.ERROR == '') {
						var precio_actual = $('#precio_actual').val();
						precio_actual = (precio_actual != '') ? parseFloat(precio_actual) : '';
						var nuevo_precio = parseFloat(data.PRECIO);

						if (precio_actual == '' || nuevo_precio <= precio_actual) {
							$('#precio_descuento').text(data.PRECIO_FORMATEADO);
							$('#precio_actual').val(nuevo_precio);
							$('#precio').addClass('descontado');

							//sync tpv-pcode
							var promocode = data.PROMOCODE;
							$forms_pago.trigger('set', ['PROMOCODE', promocode]);
							$producto.data('last_pcode', promocode);
							$('input[name="promocode_promocode_actual"]', $form).val(promocode);

							//no se pueden utilizar promocodes con paysafecard
							$('.paysafecard_submit').prop('disabled', true).addClass('disabled');

							if (precio_actual == '' || nuevo_precio < precio_actual) $('.error', $form).css('display', 'none');
							else $('.error', $form).text('Nota: el nuevo cupn no mejora el precio.').css('display', 'block');
						}
						else $('.error', $form).text('Nota: el nuevo cupn no mejora el precio, mantenemos el anterior.').css('display', 'block');

						$form.trigger('check_gratis');
					}
					else {
						$('.error', $form).text(data.ERROR).css('display', 'block');
						//if( typeof data.RESET!='undefined' && data.RESET ) $promocode.trigger('reset');
					}
				} catch (error) { }
			}, function () {
				alert('Error de conexin.');
			});

			$('input[name="promocode_recalcular"]', $form).val(0);
		});

		$('#show_promocode').click(function () {
			$('#show_promocode').hide();
			$('.promocode_form').slideDown();
		});

