		function validarPeriodoSubidas() {
			var hora_ini = $('#hora_inicio').val();
			var hora_fin = $('#hora_fin').val();
			if (!(!!hora_ini && !!hora_fin)) {
				actualizaUltimoDia();
				return true;
			}

			var primer_dia_disponible = true;
			var fecha_ini = new Date($('#fecha_inicial').val());
			if (hora_ini.padStart(5, 0) < hora_fin.padStart(5, 0) && fecha_ini.toDateString() == fecha_inicial.toDateString()) {
				hora_fin = hora_fin.split(':');
				fecha_ini.setHours(hora_fin[0]);
				fecha_ini.setMinutes(hora_fin[1]);
				primer_dia_disponible = fecha_ini.getTime() > fecha_inicial.getTime();
			}

			if (primer_dia_disponible) {
				//Cambiar fecha minima calendario a la fecha inicial
				datePickerController.setRangeLow('fecha_inicial_text', fecha_inicial);
				//TODO: Detectar cambio automatico y restaurar el primer dia?
			}
			else {
				//Seleccionar el dia siguiente y cambiar fecha minima calendario
				var fecha_correcta = new Date(fecha_inicial);
				fecha_correcta.setDate(fecha_correcta.getDate() + 1);
				bValidarPeriodoSubidas = false;
				datePickerController.setSelectedDate('fecha_inicial_text', fecha_correcta);
				datePickerController.setRangeLow('fecha_inicial_text', fecha_correcta);
				bValidarPeriodoSubidas = true;
			}

			actualizaUltimoDia();
		}

